import React from "react";

const Footer = () => {
  return (
    <footer className="bg-gray-800 text-white py-6 mt-12 text-center">
      <p className="text-sm">&copy; {new Date().getFullYear()} SITE2025. All rights reserved.</p>
    </footer>
  );
};

export default Footer;
